import { io } from "socket.io-client";
import Card from "../ui/Card";
import Report from "./Report";

/**
 * 
 * @param {[Object, Object]} props 
 */

function ReportList(props){
    const port = 5782;
    var promises = []
    props.clients.map((client)=>{
        promises.push(new Promise((resolve, rejct)=>{
            // const socket = io.connect("http://"+client+":"+port);
            const socket = io.connect(client+":"+port);
            socket.emit("get_init");
            socket.on("send_data",(data)=>{
                console.log(data);
            })
        }));
    })
    return <section>
        {props.clients.map((client,idx)=>{
            console.log(client);
            return <Card key ={idx}><Report {...client}/></Card>
        })}
    </section>
}
export default ReportList;
